contracts/Array.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.25;

contract Array {
    uint[] public nums = [1,2,3,4,5];
    //fixed size array
    uint[3] public  numsFixed = [1,2,3]; 

    function examples() external returns (uint, uint) {
        nums.push(4); // [1, 2, 3, 4]
        uint x = nums[1];

        nums[2] = 777; // [1, 2, 777, 4]
        delete nums[1]; // [1, 0, 777, 4]
        nums.pop(); // [1, 0, 777]
        uint len = nums.length;

        // create in memory
        uint[] memory a = new uint[](5);
        a[1] = 123;
        return (x, len);
    } 
}

